import axios from 'axios';

const apiUrl = "https://covid19.mathdro.id/api";
const FetchData = async () => {
    try {
        const response = await axios.get(apiUrl);
        return response;
    } catch (error) {
        console.log(error);
    }
}

export default FetchData;
